import React from 'react'
import Vote from './Vote'


const Pollsdetails = ({polls, setPolls, handleSelectPoll, pollSelected}) => {
  return (
    <div className='container pollsDetails'>
      {po}
      <Vote
        polls = {polls}
        setPolls = {setPolls}
        pollSelected={pollSelected}
      />
    </div>
  )
}

export default Pollsdetails
